import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "./Product.css"; // Import external CSS

const products = [
    { name: "Dove", category: "soap", image: "https://via.placeholder.com/100?text=Dove" },
    { name: "Lux", category: "soap", image: "https://via.placeholder.com/100?text=Lux" },
    { name: "Palmolive", category: "soap", image: "https://via.placeholder.com/100?text=Palmolive" },
    { name: "Head & Shoulders", category: "shampoo", image: "https://via.placeholder.com/100?text=H+%26+S" },
    { name: "Pantene", category: "shampoo", image: "https://via.placeholder.com/100?text=Pantene" },
    { name: "Colgate", category: "toothpaste", image: "https://via.placeholder.com/100?text=Colgate" },
    { name: "Sensodyne", category: "toothpaste", image: "https://via.placeholder.com/100?text=Sensodyne" },
    { name: "Charmin", category: "toilet-paper", image: "https://via.placeholder.com/100?text=Charmin" },
    { name: "Scott", category: "toilet-paper", image: "https://via.placeholder.com/100?text=Scott" },
    { name: "Fairy", category: "dishwashing-liquid", image: "https://via.placeholder.com/100?text=Fairy" },
    { name: "Tide", category: "laundry-detergent", image: "https://via.placeholder.com/100?text=Tide" },
    { name: "Downy", category: "fabric-softener", image: "https://via.placeholder.com/100?text=Downy" },
];

const Product = () => {
    const [search, setSearch] = useState("");
    const [category, setCategory] = useState("all");
    const [filteredProducts, setFilteredProducts] = useState(products);

    useEffect(() => {
        const filtered = products.filter(product =>
            (category === "all" || product.category === category) &&
            product.name.toLowerCase().includes(search.toLowerCase())
        );
        setFilteredProducts(filtered);
    }, [search, category]);

    return (
        <div>
            {/* Navbar */}
            <nav className="navbar">
                <div className="logo">Velavan Super Stores</div>
                <ul className="nav-links">
                    <li><Link to="/" className="nav-item">Home</Link></li>
                    <li><Link to="/products" className="nav-item">Products</Link></li>
                    <li><Link to="/cart" className="nav-item">Cart</Link></li>
                    <li><Link to="/invoice" className="nav-item">Invoice</Link></li>
                    <li><button className="logout-btn">Log Out</button></li>
                </ul>
            </nav>
            
            {/* Search Bar */}
            <div className="search-bar">
                <select value={category} onChange={(e) => setCategory(e.target.value)}>
                    <option value="all">All Categories</option>
                    <option value="soap">Soap</option>
                    <option value="shampoo">Shampoo</option>
                    <option value="toothpaste">Toothpaste</option>
                    <option value="toilet-paper">Toilet Paper</option>
                    <option value="dishwashing-liquid">Dishwashing Liquid</option>
                    <option value="laundry-detergent">Laundry Detergent</option>
                    <option value="fabric-softener">Fabric Softener</option>
                </select>
                <input 
                    type="text" 
                    className="search-input" 
                    placeholder="Search products..." 
                    value={search} 
                    onChange={(e) => setSearch(e.target.value)}
                />
            </div>

            {/* Products Grid */}
            <div className="product-grid">
                {filteredProducts.map((product, index) => (
                    <div key={index} className="product-card">
                        <img src={product.image} alt={product.name} />
                        <p className="product-name">{product.name}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Product;
